  false,\n\t\"url\": null,\n\t\"notes\": \"The Arapahoe National Wildlife Refuge Water
  Management Plan has been developed to meet the station objectives set forth in the
  Master Plan. The purpose of this plan is to establish a schedule of operations for
  the manipulation of managed waters. Purpose, usage and problems are covered. The
  current year's water usage plan and next year's recommendations are summarized.
  A pond inventory and water use is attached. The short plans for Bamforth, Hutton
  Lake, and Mortenson Lake are also included.\",\n\t\"license_title\": \"License Not
